configure:
  commands:
    end:
      new_state: execute
    interface range vlan 11-20: '% Invalid command at ''^'' marker.'
    line console 0:
      new_state: configure_line
    no logging console: ''
    no vlan dot1q tag native: "no vlan dot1q tag native\r\n"
    standby 0 priority 50: '% Invalid command at ''^'' marker.'
  prompt: 9500-Core(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: 9500-Core(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: 9500-Core#
